import React from "react";
import "./Education.css";

const Education = () => {
  return (
    <div className="eduContainer">
      My Educational Qualifications are,
      <div className="degree">
        B.Tech @ Sri Vasavi 
      </div>
      <div className="inter">
        +2 qualification in the stream of MPC from Sri Chaitanya Boys Jr.
        College, Vijayawada
      </div>
      <div className="ssc">Secondary Schooling at MSRZP High school, Ananthapalli</div>
    </div>
  );
};

export default Education;
